// App.js

import React from 'react';

function App() {
  const handleButtonClick = () => {
    const element = document.getElementById('exampleElement');

    if (element) {
      console.log('Element text content:', element.textContent);
    } else {
      console.log('Element with ID "exampleElement" not found');
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and yayyyy to reload.
        </p>
        <button onClick={handleButtonClick}>Get Element by ID</button>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
